def shove(map, x, y, dx, dy):
	nx, ny = x + dx, y + dy
	if map[nx][ny] == '#':
		return False
	elif map[nx][ny] == '.':
		map[nx][ny] = map[x][y]
		map[x][y] = '.'
		return True
	elif map[nx][ny] in ['[', ']', 'O']:
		if shove(map, nx, ny, dx, dy):
			map[nx][ny] = map[x][y]
			map[x][y] = '.'
			return True
		else:
			return False


def shove2(map, x, y, dx, dy):
	nx, ny = x + dx, y + dy
	if map[nx][ny] == '#':
		return False
	elif map[nx][ny] == '.':
		map[nx][ny] = map[x][y]
		map[x][y] = '.'
		return True
	elif dy != 0:
		if shove(map, nx, ny, dx, dy):
			map[nx][ny] = map[x][y]
			map[x][y] = '.'
			return True
		else:
			return False
	elif map[nx][ny] == '[' and shovetest(map, nx, ny + 1, dx, dy) and shovetest(map, nx, ny, dx, dy):
		powershove(map, nx, ny + 1, dx, dy)
		powershove(map, nx, ny, dx, dy)
		map[nx][ny] = map[x][y]
		map[x][y] = '.'
		return True
	elif map[nx][ny] == ']' and shovetest(map, nx, ny - 1, dx, dy) and shovetest(map, nx, ny, dx, dy):
		powershove(map, nx, ny, dx, dy)
		powershove(map, nx, ny - 1, dx, dy)
		map[nx][ny] = map[x][y]
		map[x][y] = '.'
		return True
	return False


def powershove(map, x, y, dx, dy):
	nx, ny = x + dx, y + dy
	if map[nx][ny] == '[':
		powershove(map, nx, ny + 1, dx, dy)
		powershove(map, nx, ny, dx, dy)
	elif map[nx][ny] == ']':
		powershove(map, nx, ny - 1, dx, dy)
		powershove(map, nx, ny, dx, dy)
	map[nx][ny] = map[x][y]
	map[x][y] = '.'


def shovetest(map, x, y, dx, dy, shalf=False):
	nx, ny = x + dx, y + dy
	if map[nx][ny] == '#':
		return False
	elif map[nx][ny] == '.':
		return True
	elif not shalf:
		if map[nx][ny] == '[':
			if shovetest(map, x, ny + 1, dx, dy, shalf=True) and shovetest(map, nx, ny, dx, dy):
				return True
		elif map[nx][ny] == ']':
			if shovetest(map, x, ny - 1, dx, dy, shalf=True) and shovetest(map, nx, ny, dx, dy):
				return True
	elif shalf:
		if map[nx][ny] == '[':
			if shovetest(map, nx, ny, dx, dy):
				return True
		elif map[nx][ny] == ']':
			if shovetest(map, nx, ny, dx, dy):
				return True


